import React from "react";
import {Row} from "react-bootstrap";
import Cards from "./Cards";
class TopNews extends React.Component{
    render(){
        return(
                <Row className="topnews">
                    <Cards/>
                    <Cards/>
                    <Cards/>
                    <Cards/>
                    <Cards/>
                </Row>
            
        );

    
    }
}

export default TopNews;
